                <div className='home__widget-container__card flex-row w75 g25'>
                    <Link to='/curiculum-vitae' className='home__widget-container__card__link w20 flex-center'>
                        <div className='text-center'>
                            <h2 className=''>Curiculum Vitae</h2>
                        </div>
                    </Link>
                    <Link to='/skins' className='home__widget-container__card__link w20 flex-center'>
                        <div className='text-center'>
                            <h2 className='text-center'>Skins Dofus</h2>
                        </div>
                    </Link>
                </div>

            </div>

        </div>
    )
}

export default Home;
